import { useEffect, useState } from "react";
import styles from "./styles.module.css";
import { ModalEdit } from "./components/modals/edit";
import Product from "./components/product";
import { useDispatch, useSelector } from "react-redux";
import {
    addToCart,
    removeFromCart,
    toggleEditModal,
    setCurrentProduct,
    changeProducts,
    deleteProduct,
  } from "./redux/actions";

function App() {
  const dispatch = useDispatch();
  const products = useSelector((state) => state.labReducer.products);
  const currentProduct = useSelector((state) => state.labReducer.cart);
  const modalEdit = useSelector((state) => state.labReducer.showEditModal);

  function changeCurrentProduct(product) {
    // вызов модалки с редактированием и передача текущих полей товара в неё
    dispatch(toggleEditModal());
    dispatch(setCurrentProduct(product));
  }

  return (
    <>
      <button
        className={styles.addToCart}
        style={{ position: "sticky", top: 10, left: "70vw" }}
      >
        Корзина
      </button>
      <ul className={styles.list}>
        {/* рендер списка товаров */}
        {products.map((product) => (
          <Product
            key={product.id}
            product={product}
            changeCurrentProduct={changeCurrentProduct}
          />
        ))}
        <button /*кнопка добавления нового товара */
          className={styles.blank__button}
          onClick={() =>
            changeCurrentProduct({
              id: products.length + 1,
              img: "",
              name: "",
              price: "",
              currency: "",
            })
          }
        >
          <img
            src="data:image/png;base64,"
            style={{ height: "100px", paddingInline: "65px" }}
          ></img>
        </button>
      </ul>
      {modalEdit /* рендер модалки изменения/добавления товара */ && (
        <ModalEdit
          product={currentProduct}
          changeProducts={changeProducts}
        ></ModalEdit>
      )}
    </>
  );
}

export default App;
